exports.trialpdf = async (req, res) => {
  try {
    const data = {
      name: "Neosao",
      location: "Kolhapur",
    };

    ejs.renderFile("./views/trial.ejs", data, (err, data) => {
      if (err) {
        res.status(500).json({ err: 500, msg: err.toString() });
      } else {
        let options = {
          // Allowed Units: A3, A4, A5, Legal, Letter, Tabloid
          format: "Letter",
          orientation: "portrait",
          header: {
            height: "10mm",
          },
          footer: {
            height: "10mm",
          },
          timeout: "10000000",
          height: "10.5in",
          width: "8in",
          zoomFactor: "1",
          type: "pdf",
          childProcessOptions: {
            env: {
              OPENSSL_CONF: '/dev/null',
            },
          }
        };
        pdf
          .create(data, options)
          .toFile("storage/trial/one.pdf", function (err, data) {
            if (err) {
              res.status(500).json({ err: 500, msg: err.toString() });
            } else {
              res.status(200).json({
                err: 200,
                msg: "File created successfully",
                link: `${process.env.PDF_BASE_URL}/storage/trial/one.pdf`,
              });
            }
          });
      }
    });
  } catch (error) {
    res.status(500).json({ err: 500, msg: error.toString() });
  }
};

